import React from 'react';
import PropTypes from 'prop-types';
import './DataCards.scss';
import { PAGE } from '../../utils/constants';

const DataCards = props => {
  const { data, actions, page } = props;
  console.log("Users:", props);
  let key = 0;
  const cards =
    data &&
    data instanceof Array &&
    data.map(each => {
      key += 1;

      // if(each && Object.values(each).length>0){
        return (
          <div className="col col-12 col-lg-3 col-md-4 mb-3" key={key}>
            <button
              className="btn h-100  w-100  border data-card  "
              onClick={() => actions.listHandler(each.Id, props)}
              id={`data-card-${key}`}
            >
              <div className="card-title">{each.title}</div>
              {each.body}
            </button>
          </div>
        );
      // }
      // return true;
    });
  return <div className="row cards">{cards}</div>;
};

DataCards.propTypes = {
  data: PropTypes.oneOfType([PropTypes.array, PropTypes.object]).isRequired,
  actions: PropTypes.object.isRequired
};

export default DataCards;
